import {Link} from 'react-router-dom';
import { useEffect } from 'react';
import { useWorkoutsContext } from './hooks/useWorkoutsContext';
import { useAuthContext } from './hooks/useAuthContext';

const Home = () => {
  const {workouts,dispatch} = useWorkoutsContext();
  const {user} = useAuthContext()

    useEffect(()=>{
      const fetchWorkouts = async () =>{
        const response = await fetch('/nat/workouts')
        const json = await response.json()


        if(response.ok){
            //setWorkouts(json)
            dispatch({type: 'SET_WORKOUTS',payload: json})
        }
      }

    fetchWorkouts()
    },[dispatch])
    return (
        <div className = 'home'>
            <title>
              Gym Tracker Site
            </title>
            <nav>
                <button>
                    <Link to="/create" className='link'><strong>Add a Workout</strong></Link>
                </button>
            </nav>
            
            <div>
              <h2> Previous Workouts</h2>
                {workouts && workouts.map((workout)=> (
                  <Link to = {`/workouts/${workout._id}`}>
                    <div className="workout-preview" key={workouts._id}>
                          <p className='label'><strong>{workout.date}</strong> <br /> <span> {workout.type}</span>                 </p>
                          
                    </div> 
                  </Link>
                ))}
            </div>
            
            
           
        </div>
    );
}
 
export default Home;
